import React, { useState } from 'react';
import './style/App.css';
import TelaInicial from "./components/TelaInicial";
const App = props => {
    const changeRota = (value) => {
        let [ state ] = this.useState({
            rota: 'Login'
        })
        console.log('value: ', value)
        state.rota = value
    }
    return <TelaInicial rota={this.state.rota} onCadastrar={event => changeRota('Cadastro') } onVoltar={event => changeRota('Login') }/>;
}

export default App;
